function RowLayout(props) {
  return (
    <>
      <div className="container-fluid">
        <ul className="listStyleNone">
          <li key="upperSection">
            <UpperSec />
          </li>
          <li key="mainSection">
            <MainSec count="10" books={props.books} />
          </li>
        </ul>
      </div>
    </>
  );
}

function UpperSec(props) {
  return (
    <>
      <div className="container-fluid">
        <div className="row some text-center">
          <div className="col">
            <p>--Category Name</p>
          </div>
          <div className="col text-right">
            <p>--Search Icon</p>
          </div>
        </div>
      </div>
    </>
  );
}

function MainSec(props) {
  var books = [];
  props.books.then((val))
  for (let i = 0; i < props.count; i++) {
    books.push(<li>{props.books[i].title}</li>);
  }
  return (
    <>
      <div className="container-fluid row">
        <ul>
          {books.map((book) => (
            <li key={book.id}>{book.title}</li>
          ))}
        </ul>
      </div>
    </>
  );
}

async function GetBooks(subject) {
  const response = await fetch(
    "https://www.googleapis.com/books/v1/volumes?q=subject:${subject}"
  );

  return response.json();
}

function Layout(props) {
  var emptyList = [];
  const _count = parseInt(props.count);
  console.log(_count);
  for (let i = 0; i < _count; i++) {
    emptyList.push(
      <li key={i}>
        <RowLayout books={GetBooks()} />
      </li>
    );
  }
  return (
    <>
      <ul className="listStyleNone">{emptyList}</ul>
    </>
  );
}

export default Layout;
